import { Box, Button, Heading, SimpleGrid } from "@chakra-ui/react";
import NavBar from "../components/NavBar";

const LandingPage = () => {
    return(
        <>
        <NavBar/>
        <Box height="100vh" position="relative" bgColor="#F5F7FA" bgSize="cover">
            <SimpleGrid column={2} spacing={10}>
                <Box paddingLeft='10'>
                    <Heading fontSize='8xl' paddingTop='60' as='h1' textColor="#4D4D4D"> Solo Mina Fish </Heading>
                    <Heading paddingTop='5' size='2xl' as='h3' textColor='#4CAF4F'> Since 20 Years</Heading>
                    <Heading paddingTop='5' as='h3'>Fish Consumption Supplier</Heading>
                    <Box paddingTop='8'>
                        <Button size='lg' bgColor='#4CAF4F' textColor='white'>Contact</Button>
                    </Box>
                </Box>
            </SimpleGrid>
        </Box>
        </>
    )
};

export default LandingPage;
